    {
      "lineNumber": 202602,
      "originalJapaneseLine": "「行くぞ！！！！」",
      "translatedEnglishLine": "\"Let's go!!!!\""
    },
    {
      "lineNumber": 202603,
      "originalJapaneseLine": "「なんだかよく分かんないけど！",
      "translatedEnglishLine": "\"I don't really understand, but!"
    },
    {
      "lineNumber": 202604,
      "originalJapaneseLine": "　やっつけてやる！」",
      "translatedEnglishLine": "I'm gonna beat you up!\""
    },
    {
      "lineNumber": 202605,
      "originalJapaneseLine": "「ちっ！",
      "translatedEnglishLine": "\"Tch!\""
    },
    {
      "lineNumber": 202606,
      "originalJapaneseLine": "　＜エール＞、俺の後ろに来い！」",
      "translatedEnglishLine": "\"<Yell>, get behind me!\""
    },
    {
      "lineNumber": 202607,
      "originalJapaneseLine": "「戦闘だ！」",
      "translatedEnglishLine": "\"It's battle time!\""
    },
    {
      "lineNumber": 202608,
      "originalJapaneseLine": "天空の王――",
      "translatedEnglishLine": "The King of the Sky——"
    },
    {
      "lineNumber": 202609,
      "originalJapaneseLine": "魔人かわぞえが襲いかかってきた！",
      "translatedEnglishLine": "The demon Kawazoe attacked!"
    },
    {
      "lineNumber": 202610,
      "originalJapaneseLine": "「きゃー！？",
      "translatedEnglishLine": "\"Kyaa!?\""
    },
    {
      "lineNumber": 202611,
      "originalJapaneseLine": "　奈落の王、ますぞえ様が倒されたー！？",
      "translatedEnglishLine": "The King of the Abyss, Masuzoe-sama, has been defeated!?"
    },
    {
      "lineNumber": 202612,
      "originalJapaneseLine": "「うわーん！？　嘘よー！」",
      "translatedEnglishLine": "\"Waaah!? That's a lie!\""
    },
    {
      "lineNumber": 202613,
      "originalJapaneseLine": "「うう、しくしく……",
      "translatedEnglishLine": "\"Uu, sob sob...\""
    },
    {
      "lineNumber": 202614,
      "originalJapaneseLine": "　ますぞえ様が復活されるときを待ちましょう……",
      "translatedEnglishLine": "Let's wait for the time when Masuzoe-sama will be revived..."
    },
    {
      "lineNumber": 202615,
      "originalJapaneseLine": "　行くわよ、みんな……しくしく……」",
      "translatedEnglishLine": "Let's go, everyone... sniff sniff...\""
    },
    {
      "lineNumber": 202616,
      "originalJapaneseLine": "取り巻きのハニ子達はさめざめと泣きながら、",
      "translatedEnglishLine": "The surrounding Honey-chan and others cried bitterly,"
    },
    {
      "lineNumber": 202617,
      "originalJapaneseLine": "とぼとぼと去って行った。",
      "translatedEnglishLine": "and trudged away."
    },
    {
      "lineNumber": 202618,
      "originalJapaneseLine": "ますぞえが倒れた後に残されたのは、",
      "translatedEnglishLine": "After Masuzoe collapsed, what remained was"
    },
    {
      "lineNumber": 202619,
      "originalJapaneseLine": "一つの宝箱だった。",
      "translatedEnglishLine": "a single treasure chest."
    },
    {
      "lineNumber": 202620,
      "originalJapaneseLine": "「きゃー！？",
      "translatedEnglishLine": "\"Kyaa!?\""
    },
    {
      "lineNumber": 202621,
      "originalJapaneseLine": "　天空の王、かわぞえ様が倒されたー！？",
      "translatedEnglishLine": "The King of the Sky, Kawazoe-sama, has been defeated!?"
    },
    {
      "lineNumber": 202622,
      "originalJapaneseLine": "「うわーん！？　嘘よー！」",
      "translatedEnglishLine": "\"Waaah!? That's a lie!\""
    },
    {
      "lineNumber": 202623,
      "originalJapaneseLine": "「うう、しくしく……",
      "translatedEnglishLine": "\"Uu, sob sob...\""
    },
    {
      "lineNumber": 202624,
      "originalJapaneseLine": "　かわぞえ様が復活されるときを待ちましょう……",
      "translatedEnglishLine": "Let's wait for the time when Kawazoe-sama will be revived..."
    },
    {
      "lineNumber": 202625,
      "originalJapaneseLine": "　行くわよ、みんな……しくしく……」",
      "translatedEnglishLine": "Let's go, everyone... sniff sniff...\""
    },
    {
      "lineNumber": 202626,
      "originalJapaneseLine": "取り巻きのハニ子達はさめざめと泣きながら、",
      "translatedEnglishLine": "The surrounding Honey-chan and others cried bitterly,"
    },
    {
      "lineNumber": 202627,
      "originalJapaneseLine": "とぼとぼと去って行った。",
      "translatedEnglishLine": "and trudged away."
    },
    {
      "lineNumber": 202628,
      "originalJapaneseLine": "かわぞえが倒れた後に残されたのは、",
      "translatedEnglishLine": "After Kawazoe fell, what remained was"
    },
    {
      "lineNumber": 202629,
      "originalJapaneseLine": "一つの宝箱だった。",
      "translatedEnglishLine": "a single treasure chest."
    },
    {
      "lineNumber": 202630,
      "originalJapaneseLine": "あなたはその宝箱に近づく。",
      "translatedEnglishLine": "You approach that treasure chest."
    },
    {
      "lineNumber": 202631,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 202632,
      "originalJapaneseLine": "一瞬、中から光が溢れて、",
      "translatedEnglishLine": "For a moment, light overflowed from inside,"
    },
    {
      "lineNumber": 202633,
      "originalJapaneseLine": "アームズに聞いていた通りの道具が飛び出して来た。",
      "translatedEnglishLine": "and the tool Arms had told you about came flying out."
    },
    {
      "lineNumber": 202634,
      "originalJapaneseLine": "あなたはレアアイテムをゲットした。",
      "translatedEnglishLine": "You obtained a rare item."
    },
    {
      "lineNumber": 202635,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 202636,
      "originalJapaneseLine": "ぽつーん。",
      "translatedEnglishLine": "(silence)"
    },
    {
      "lineNumber": 202637,
      "originalJapaneseLine": "それはそれとしてあなたは一人だった。",
      "translatedEnglishLine": "That said, you were alone."
    },
    {
      "lineNumber": 202638,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 202639,
      "originalJapaneseLine": "もうここに用もない。",
      "translatedEnglishLine": "You have no more business here."
    },
    {
      "lineNumber": 202640,
      "originalJapaneseLine": "あなたはランス城に帰ることにした。",
      "translatedEnglishLine": "You decided to return to Rance Castle."
    },
    {
      "lineNumber": 202641,
      "originalJapaneseLine": "「へ……」",
      "translatedEnglishLine": "\"Heh...\""
    },
    {
      "lineNumber": 202642,
      "originalJapaneseLine": "「へへへへ……！」",
      "translatedEnglishLine": "\"Hehehehe...!\""
    },
    {
      "lineNumber": 202643,
      "originalJapaneseLine": "「やっぱ俺らって最強じゃね！？",
      "translatedEnglishLine": "\"We're really the strongest, right?!"
    },
    {
      "lineNumber": 202644,
      "originalJapaneseLine": "　こんなすごい冒険も大成功よ！」",
      "translatedEnglishLine": "This amazing adventure was a huge success!\""
    },
    {
      "lineNumber": 202645,
      "originalJapaneseLine": "「いや、やっぱさ、なんてーの、なんてーの？",
      "translatedEnglishLine": "\"No, seriously, how should I say it, how should I say it?"
    },
    {
      "lineNumber": 202646,
      "originalJapaneseLine": "　俺ら二人控えめに言って無敵のコンビっつーか？」",
      "translatedEnglishLine": "The two of us, to put it mildly, are an unbeatable duo, right?\""
    },
    {
      "lineNumber": 202647,
      "originalJapaneseLine": "「こりゃもう、ソウルフレンドなんてもんじゃ、",
      "translatedEnglishLine": "\"This is more than just soul friends,"
    },
    {
      "lineNumber": 202648,
      "originalJapaneseLine": "　マジ俺ら二人の関係くくれねーって……",
      "translatedEnglishLine": "I seriously can't even put our relationship into a category..."
    },
    {
      "lineNumber": 202649,
      "originalJapaneseLine": "　なんて言うんだろーな、何がいいだろーな」",
      "translatedEnglishLine": "I wonder what you'd call it, what would be good?\""
    },
    {
      "lineNumber": 202650,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 202651,
      "originalJapaneseLine": "「……親友」",
      "translatedEnglishLine": "\"...Best friends.\""
    },
    {
      "lineNumber": 202652,
      "originalJapaneseLine": "「逆にシンプルに親友とか！？",
      "translatedEnglishLine": "\"Or simply best friends!?"
    },
    {
      "lineNumber": 202653,
      "originalJapaneseLine": "　どーよ、一周回ってこれよくね！？」",
      "translatedEnglishLine": "How about that? After all, this is pretty good!?\""
    },
    {
      "lineNumber": 202654,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 202655,
      "originalJapaneseLine": "「なー！　だろー！？",
      "translatedEnglishLine": "\"Right! Isn't it!?\""
    },
    {
      "lineNumber": 202656,
      "originalJapaneseLine": "　＜エール＞もそう思うだろー！？」",
      "translatedEnglishLine": "\"<Yell>, you think so too, right!?\""
    },
    {
      "lineNumber": 202657,
      "originalJapaneseLine": "調子のいい長田君が",
      "translatedEnglishLine": "The upbeat Nagata-kun"
    },
    {
      "lineNumber": 202658,
      "originalJapaneseLine": "あれやこれや喋っているのを、",
      "translatedEnglishLine": "was chatting away about this and that,"
    },
    {
      "lineNumber": 202659,
      "originalJapaneseLine": "あなたはこくこくと頷きながら聞き続けた。",
      "translatedEnglishLine": "and you kept listening, nodding your head."
    },
    {
      "lineNumber": 202660,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 202661,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    }
  ]
}

